udtInstanceFilter = {"tagType":"UdtInstance","typeID":value['type'],'recursive':True}
udtInstanceFilter = {"tagType":"UdtInstance",'recursive':True}
cfgAlarms = {'recursive':True,"tagType":"UdtInstance",'typeID':'Standard/Alarms/Alarm Primitive'}
cfgFilter = {'recursive':True,'tagType':'AtomicTag'}


udtInstances = system.tag.browse(path=value['tagPath'], filter=udtInstanceFilter)

modules = []
for udtInstance in udtInstances:
	fullPath = str(udtInstance['fullPath'])
	name = udtInstance['name']
	module = {}
	module['Name'] = name
	module['InstanceFullPath'] = fullPath

	#Alarms
	alarmTags = system.tag.browse(path=fullPath+"/Alarms", filter=cfgAlarms)


	alarms = {}
	for alarmTag in alarmTags:
		alarmName = alarmTag['name']
		alarms[alarmName] = {}
		alarmTagPath = str(alarmTag['fullPath'])
		#alarms[alarmName]['FullPath'] = alarmTagPath

		#Configuration
		cfgs = system.tag.browse(path=alarmTagPath+"/Cfg", filter=cfgFilter)
		setpoints = {}
		for cfg in cfgs:
			setpointName = cfg['name']
			setpoints[setpointName] = {}
			setpoints[setpointName]['DataType'] = cfg['dataType']
			setpoints[setpointName]['value'] = cfg['value']
			setpoints[setpointName]['FullPath'] = str(cfg['fullPath'])
		alarms[alarmName]['Configuration'] = setpoints

	module['Alarms'] = alarms


	modules.append(module)


return modules

